import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";

const Product = ({ item: { title, price, description, img } }) => {
  console.log(img);
  return (
    <div style={{ width: "14rem" }}>
      <Card>
        <CardImg
          top
          width="100%"
          src={require("../images/Header-Background.jpg")}
          alt="product"
        />
        <CardBody>
          <CardTitle>{title}</CardTitle>

          <CardText>{description}</CardText>
          <CardSubtitle>Price: ${price}</CardSubtitle>
          <Button>Buy</Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default Product;
